[respond]
[include chopper_tune.cfg]
[include KAMP_Settings.cfg]
[include mainsail.cfg]
[include aux_fan.cfg]
[include TEST_SPEED.cfg]

[auto_speed]
accel_max: 160000.0    ; Maximum acceleration test may try


[include moonraker_obico_macros.cfg]

# host MCU service is preinstalled and ready to use with:
[mcu rpi]
serial: /tmp/klipper_host_mcu

[mcu]
##  Obtain definition by "ls -l /dev/serial/by-id/" then unplug to verify
##--------------------------------------------------------------------
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_370042000451323336333538-if00
restart_method: command
##--------------------------------------------------------------------

[bed_mesh]
algorithm: bicubic
speed: 800
mesh_min: 35, 35
mesh_max: 215, 215
probe_count: 50, 50

[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_AE6AE7AD5157355957202020FF0D1320-if00
x_offset: 0
y_offset: 27.065
mesh_main_direction: x
mesh_runs: 1

[resonance_tester]
accel_chip: beacon
probe_points: 117.5, 117.5, 30

[printer]
kinematics: corexy
max_velocity: 1000
max_accel: 90000
#max_accel_to_decel: 5000
max_z_velocity: 10
max_z_accel: 1000
square_corner_velocity: 40

[stepper_y]
##	in M6 position
step_pin: PE0
dir_pin: PG3
enable_pin: !PG4
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200  
endstop_pin: PG11
position_endstop: 0
position_min: 0
position_max: 235
homing_speed: 60 
homing_retract_dist: 0

[tmc5160 stepper_y] 
#spi_bus: spi3
cs_pin: PG2
#diag_pin: PA8
interpolate: false
run_current: 2.1
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_TBL: 0
driver_TOFF: 1
driver_DISS2G: 1
driver_DISS2VS: 1
driver_TPFD: 0


[stepper_x1]
##	in M5 position
step_pin: PE1
dir_pin: PF0
enable_pin: !PC15
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200
#endstop_pin: tmc5160_stepper_x:virtual_endstop 

[tmc5160 stepper_x1] 
#spi_bus: spi3
cs_pin: PF1
#diag_pin: PD6
interpolate: false
run_current: 2.1
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_TBL: 0
driver_TOFF: 1
driver_DISS2G: 1
driver_DISS2VS: 1
driver_TPFD: 0


[stepper_x]
##	in M4 position
step_pin: PE15
dir_pin: PE11
enable_pin: !PF2
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200  
endstop_pin: PG10
position_endstop: -0
position_min: 0
position_max: 235
homing_speed: 60   
homing_retract_dist: 0

[tmc5160 stepper_x] 
#spi_bus: spi3
cs_pin: PE10
#diag_pin: PD7
interpolate: false
run_current: 2.1
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_SGT: -64 # -64 is most sensitive value, 63 is least sensitive
driver_TBL: 0
driver_TOFF: 1
driver_DISS2G: 1
driver_DISS2VS: 1
driver_TPFD: 0


[stepper_y1]
##	in M3 position
step_pin: PE14
dir_pin: PE8
enable_pin: !PE9
rotation_distance: 40
microsteps: 64
full_steps_per_rotation: 200
#endstop_pin: tmc5160_stepper_y:virtual_endstop  

[tmc5160 stepper_y1] 
#spi_bus: spi3
cs_pin: PE7
#diag_pin: PG9
interpolate: false
run_current: 2.1
sense_resistor: 0.033
spi_software_mosi_pin: PB5
spi_software_miso_pin: PB4
spi_software_sclk_pin: PB3
driver_SGT: -64 # -64 is most sensitive value, 63 is least sensitive
driver_TBL: 0
driver_TOFF: 1
driver_DISS2G: 1
driver_DISS2VS: 1
driver_TPFD: 0


#########################

[stepper_z]
## In M1 position
step_pin: PE2
dir_pin: PC5
enable_pin: !PF11
microsteps: 128
rotation_distance: 4
#position_endstop: 0.0
position_min: -0.2
position_max: 200
full_steps_per_rotation: 200
endstop_pin: probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
homing_positive_dir: false
homing_speed: 10
second_homing_speed: 2.5

[tmc2209 stepper_z]
interpolate: true
uart_pin: PC4
run_current: 1.2
#stealthchop_threshold: 9999

[safe_z_home]
home_xy_position: 117.5, 117.5 # update for your machine
z_hop: 3

